    data: |
      SELECT ALL + CAST ( - - CAST ( NULL AS REAL ) AS INTEGER ) * col2 + + + col0 - - 75 * + - col2 * + col2 AS col0, 96 AS col1 FROM tab0;
  - name: tab0

outputs:
  - name: q210.out
    data: |
      NULL	96
      NULL	96
      NULL	96
